import React, { useEffect, useState } from 'react';
import usePumpFunData from '../hooks/usePumpFunData';

const NewCoinsTrackerCard = () => {
  const [newCoins, setNewCoins] = useState([]);
  const [isLoading, setIsLoading] = useState(true);

  // Use the pump.fun data hook
  const { data, loading } = usePumpFunData('new');

  useEffect(() => {
    if (!loading && data) {
      // Assuming data contains new coins information
      setNewCoins(data.slice(0, 5)); // Show latest 5 new coins
      setIsLoading(false);
    }
  }, [data, loading]);

  const formatTime = (timestamp) => {
    const date = new Date(timestamp);
    return date.toLocaleTimeString();
  };

  if (isLoading) {
    return (
      <div className="bg-white rounded-lg shadow-lg p-6">
        <h2 className="text-xl font-bold mb-4">New Coins</h2>
        <div className="space-y-4">
          {[...Array(5)].map((_, index) => (
            <div key={index} className="animate-pulse">
              <div className="flex justify-between items-center">
                <div className="h-4 bg-gray-200 rounded w-32"></div>
                <div className="h-4 bg-gray-200 rounded w-24"></div>
              </div>
              <div className="h-3 bg-gray-100 rounded w-20 mt-1"></div>
            </div>
          ))}
        </div>
      </div>
    );
  }

  return (
    <div className="bg-white rounded-lg shadow-lg p-6">
      <h2 className="text-xl font-bold mb-4">New Coins</h2>
      <div className="space-y-4">
        {newCoins.map((coin, index) => (
          <div key={index} className="border-b last:border-b-0 pb-2 last:pb-0">
            <div className="flex justify-between items-center">
              <span className="font-medium">{coin.name}</span>
              <span className="text-sm text-gray-600">{formatTime(coin.createdAt)}</span>
            </div>
            <div className="text-sm text-gray-500 mt-1">
              {coin.address.slice(0, 8)}...{coin.address.slice(-8)}
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default NewCoinsTrackerCard;
